import './App.css';
import AddAlbum from './AddAlbum';
import Main from './Main'
import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <>
      <Routes>
        <Route path='/addalbum' element={ <AddAlbum/> } />
        <Route path='/' element={ <Main/> } />
      </Routes>
    </>
  );
}

export default App;
